import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <>
      <h1>learn</h1>
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> i am learning react
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            ashpak shaikh
          </a>
        </header>
      </div>
    </>
  );
}

export default App;
